package com.tuespot.controller;

import java.util.List;

import org.openqa.selenium.By;
import org.openqa.selenium.WebElement;
import org.openqa.selenium.chrome.ChromeDriver;
import org.openqa.selenium.chrome.ChromeOptions;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.RestController;

import com.tuespot.model.Candidate;

@RestController()
public class CandidateRegistration {

	@GetMapping("/getCandidate")
	public void getCandidate() {

//		System.setProperty("webdriver.edge.driver", "C://EdgeDriver.exe");
		System.setProperty("webdriver.chrome.driver", "C:\\chrome15\\chromedriver.exe");

		ChromeOptions options = new ChromeOptions();
		options.addArguments("--remote-allow-origins=*");
		// Initiating your chromedriver
		ChromeDriver driver = new ChromeDriver(options);

		driver.get("https://www.linkedin.com/login");
		WebElement username = driver.findElement(By.id("username"));
		WebElement password = driver.findElement(By.id("password"));

		username.sendKeys("sagar657r@protonmail.com");
		password.sendKeys("1234saga5678");

		driver.findElement(By.className("btn__primary--large")).click();

		driver.get("https://www.linkedin.com/pub/dir/+/Java+Developer");

		driver.manage().window().maximize();

		WebElement findElement = driver
				.findElement(By.xpath("/html/body/div[5]/div[3]/div[2]/div/div[1]/main/div/div/div[2]/div/ul"));

		List<WebElement> list = findElement.findElements(By.tagName("li"));

		System.out.println("list size = " + list.size());

		for (WebElement li : list) {
			WebElement href = li.findElement(By.tagName("a"));
			ChromeDriver candidateDetails = new ChromeDriver(options);

			candidateDetails.get(href.getAttribute("href"));

			try {
				candidateDetails
						.findElement(By.xpath("//*[@id=\"public_profile_contextual-sign-in\"]/div/section/button"))
						.click();
			} catch (Exception e) {
				e.getStackTrace();
			}

			// find username , candidateName
			String candidateName = candidateDetails
					.findElement(By
							.xpath("//*[@id=\"main-content\"]/section[1]/div/section/section[1]/div/div[2]/div[1]/h1"))
					.getText();
			System.out.println("username = " + candidateName);

			// find address
			String address = candidateDetails
					.findElement(By.xpath(
							"//*[@id=\"main-content\"]/section[1]/div/section/section[1]/div/div[2]/div[1]/h3/div"))
					.getText();
			System.out.println("address =  " + address);

			// find profileHeadline
			String profileHeadline = candidateDetails
					.findElement(By
							.xpath("//*[@id=\"main-content\"]/section[1]/div/section/section[1]/div/div[2]/div[1]/h2"))
					.getText();
			System.out.println("profileHeadline" + profileHeadline);

			// find description
			String description = candidateDetails
					.findElement(By.xpath("//*[@id=\"main-content\"]/section[1]/div/section/section[2]")).getText();
//			String by = candidateDetails.findElement(By.xpath("//*[@id=\"main-content\"]/section[1]/div/section/section[2]/div/p")).getText();

			System.out.println("description" + description);
			if (description == null) {
				description = "Screening 0026 Interviewing Candidates.";
			}

//			System.out.println("by"+by);
			Candidate candidateModel = new Candidate();
			candidateModel.setUsername(candidateName);
			candidateModel.setName(candidateName);
			candidateModel.setPassword("9087685");

			String email = candidateName;
			// for email get only first word
			if (candidateName.contains(" ")) {
				email = candidateName.substring(0, candidateName.indexOf(" "));
				System.out.println(email);
			}

			candidateModel.setEmail(email + "@gmail.com");
			candidateModel.setMobileNumber("8855598943");
			candidateModel.setAddress(address);
			candidateModel.setState(17);
			candidateModel.setDistrict(591);
			candidateModel.setCity(6217);
			candidateModel.setPinCode(128854L);
			candidateModel.setProfileHeadline(profileHeadline);
			candidateModel.setDescription(description);
			candidateModel.setStatus(true);
			candidateModel.setResume(
					"data:application/pdf;");
			candidateModel.setImage(
					"data:image/pdf;base64,");

			CandidatePostServices candidatePostServices = new CandidatePostServices();
			candidatePostServices.postCandidate(candidateModel);
			candidateDetails.close();
		}
	}
}
